INSERT INTO `assessment_category_question` VALUES (1,1,3,'Software Design with Java - How familiar are you with; Object Oriented Design techniques to produce clean and modular code. If you have completed software design for full Software Development LifeCycle (SDLC) starting from initial high level requirements to final implementation including code guardian responsibility, then this should be considered Advanced.'),(2,1,3,'Core Java - To be considered \'Advanced\', you should understand all the primitive types and operators, understand the class loading process and how class loaders work, have used JUnit and have hands-on experience with Multi-threading, security & networking components. All of these should have been done in production code to be considered \'Advanced\'.'),(3,1,2,'JEE Frameworks - How well do you know the JEE specification and APIs? Have you written code that utilizes Java EE technologies and have you created & used EJB\'s, and implemented a design using JMS, JPA, JCA and have hands-on experience with Spring, Struts, Hibernate? If so then this would be considered \'Advanced\'.'),(4,1,2,'Design Patterns - Are you familiar with design patterns, have you used them in any of your current or previous projects? \'Advanced\' would be if you have are familiar with, and used at least two of the commonly known design patterns; e.g. GoF, MVC, Singleton, Factory, Fly-weight, Builder, Object Pool, Iterator, Strategy, Visitor, or Composite.'),(5,1,1,'Oracle Java Certification - Associate=Medium, Professional=Advanced, Master=Expert'),(6,1,2,'Database - How many databases have you used? Can you optimize database queries. \'Advanced\' would be someone who has worked extensively with SQL and/or non-SQL databases, and is experienced with implementation & optimization of Stored Procedures and complex SQL queries.'),(7,1,3,'JavaScript - What level can you program in Javascript? If you have experience with, and have experience of the following Javascript techniques in Production code; Prototypes, Promises and Ajax calls, then this would be considered \'Medium\'.'),(8,1,2,'UI Frameworks - If you have experience with & are proficient in any single UI framwork, this would be considered \'Medium\'. If you are experienced & proficient in all of React and Angular including code guardian responsibility, then this would be considered \'Advanced\'.'),(9,2,2,'IDE\'s - How many different IDE’s have you used, can you easily switch between Eclipse and IntelliJ? If you can customize the IDE and add plug-in\'s to an IDE, then this would be \'Medium\'.'),(10,2,3,'Ant/Maven - Can you fix build issues yourself (\'Medium\'), or do you need support from other experts (\'Basic\'). Have you used the full capabilities of Maven, multiple Maven projects, dependency mgmt ? (\'Advanced\')'),(11,2,3,'Version Control (GIT) - How proficient are your skills in Git – for example, are you the goto person in your team for Git issues? Can you resolve conflicts and are experienced with utilizing the full capabilities of Git? (\'Advanced\'). '),(12,2,3,'Code Commit Process - Extensive experience with all of the following is considered \'Advanced\'; Commit process including Jenkins pre-code review, CI flow, Gerrit, repositories. '),(13,3,3,'Test Automation - An expert will have detailed knowledge and extensive experience in all of the following: Test automation strategies, knowing when and what to automate, extensive experience with tools such as Selenium/ Cucumber/Test Automation frameworks, scripting, integrating tests to CI and CD flows, coding of automated test cases, coding of automated test cases'),(14,3,2,'Test Management frameworks - An expert will have detailed knowledge and extensive experience in all of the following: Test campaign design, Jira framework, test coverage analysis and reporting tools ( Gerrit, Jmeter , Jenkins ) , compiling meaningful test reports, progress status reporting'),(15,3,2,'System Troubleshooting - An expert will have detailed knowledge and extensive experience in all of the following: Advanced troubleshooting and debugging through multiple layers, DB Query and Procedure call troubleshooting, UI troubleshooting, memory leak analysis,system performance analysis, Creation and analysis of logging and tracing , system level monitoring tools'),(16,3,3,'Test Design and strategies - An expert will have detailed knowledge and extensive experience in all of the following: Test case design, experience of Unit, functional, Feature, System level Endurance/ Robustness / Performance testing, test configuration management, node and network simulation, bounded application testing, test environment analysis'),(17,4,3,'Scripting - An expert will have detailed knowledge & extensive experience in all of the following: Python, Linux Shell scripts, Perl, AWK'),(18,4,3,'Third Party Systems API Calls - An expert will have detailed knowledge & extensive experience in all of the following: Implementation of & integration towards 3rd Party APIs - REST APIs, SDKs'),(19,4,2,'Enterprise Integration Patterns - An expert will have detailed knowledge & extensive experience in all of the following: Messaging patterns & technologies like JMS, Rabbit MQ, Active MQ, Apache Camel, Apache Kafka'),(20,4,2,'O/S Platform - An expert will have detailed knowledge & extensive experience in all of the following: Installing & configuring Operating System & Platform from bare metal - deploy VMs, experience with Cobbler'),(21,4,1,'Virtualization - An expert will have detailed knowledge & extensive experience in all of the following: Hypervisor, VMWare, KVM'),(22,5,2,'HTTP/HTTPS Methods (GET, POST) - How extensively have you used these methods in your work. If you have designed using these methods, then this would be considered \'Medium\'.'),(23,5,3,'Web Services (REST, SOAP) - What is your experience in this area? Can you interpret / write JSON/XML files? For example, if you have created both RESTful & SOAP web services and know the architectural differences between both, then this would be consider \'Medium\'.'),(24,5,1,'API Management (Swagger, OAS) - Have you used any API management tools?If you have experience using both Postman and openAPI, then this would be considered \'Medium\'.'),(25,6,3,'CI Pipelining - An expert will have detailed knowledge and extensive experience in all of the following: Continuous integration principles, integrating CI Tools ( Maven, Jenkins,Docker, Camunda), release automation, BASH/Shell/Python scripting, release flows, continuous deployment, Dev-ops principles '),(26,6,2,'Cloud Technologies - An expert will have detailed knowledge and extensive experience in all of the following: knowledge of private and public cloud technologies (Openstack, VMWare, AWS, Azure), configuration of cloud resources , VPC configuration , networking in the cloud, cloud installation , cloud monitoring '),(27,6,3,'System Administration - An expert will have detailed knowledge and extensive experience in all of the following: Linux Administration, virtualization management, security management and administration, s/w application installation and management, file system administration, storage administration ,system upgrading, CPU and memory resource administration'),(28,6,2,'IP Networking - An expert will have detailed knowledge and extensive experience in all of the following: Knowledge and experience of IP Routing, Routing protocols, DNS, DHCP, SSH, Tunneling, Layer 2 / 3 IP network configuration, configure and manage VPN, policy management'),(29,7,3,'JAR/EAR/WAR Deployment - An expert will have detailed knowledge & extensive experience in all of the following: Deployment & Un-deployment of JAR/EAR/WAR files via both Admin console of App. Servers such as JBoss, Glassfish, WebSphere, Tomcat and also on the application Server instance from the command line.'),(30,7,2,'Multi-Platform Deployment - An expert will have detailed knowledge & extensive experience in all of the following: Deployment of Physical & Cloud platforms'),(31,7,2,'Server Migration - An expert will have detailed knowledge & extensive experience in all of the following: Migration of server data & configuration from one server to another'),(32,7,1,'Install/Upgrade Orchestration - An expert will have detailed knowledge & extensive experience in all of the following: Managing Upgrade availability, high availability, experience with Puppet or similar.'),(33,7,3,'JBOSS/Glassfish Administration - An expert will have detailed knowledge & extensive experience in all of the following: Install, configure, monitor, manage, and deploy applications to application servers like JBoss and/or Glassfish'),(34,8,3,'High Availability engineering - An expert will have detailed knowledge & extensive experience in all of the following: designing for failure, clustering ,designing for redundancy, fault tolerant s/w design, fail-over strategies, destructive and robustness testing experience, Microservices and distributed architectures, exception handling'),(35,8,2,'Scaling SW Systems - An expert will have detailed knowledge and extensive experience in all of the following: Load balancing at system and application level, knowledge and experience of horizontal and vertical s/w scaling techniques, elastic scaling, compute resource capability, system dimensioning, multi-threading'),(36,8,2,'High Performance engineering - An expert will have detailed knowledge and extensive experience in all of the following: low latency / high performance computing, proficient in use of performance profiling tools such as JMeter and Sonarqube, performance testing , memory optimization, garbage collection.'),(37,8,2,'SW System Extensibility - An expert will have detailed knowledge and extensive experience in all of the following: Microservices architectures, distributed computing , technical debt analysis and elimination, clean code principles , modular design, layered architectures , OOD.'),(38,8,3,'SW System Upgradability - An expert will have detailed knowledge and extensive experience in all of the following: Backwards and forwards compatibility design, redundancy , maintaining availability during upgrade, dimensioning, cluster design, rolling upgrade design, model driven development, design for anywhere to anywhere upgrades, upgrade mechanisms ( puppet ), software patching.');
